import React from 'react';

import './App.css';

import Header from './header/header.js';

function App() {
  return (
    <div className="App color1 ">
      <div className="row">
        <div className="col-md-2"/>
        <div className="col-md-9">
          <Header></Header>
        </div>
        <div className="col-md-1"/>
      </div>

    </div>
  );
}

export default App;
